//Project type
export async function generateInputs(project) {
  const organization = await prisma.organization.findUnique({
    where: { id: project?.organizationId },
  });
  return [
    {
      semester: `${project?.trimester} ${project?.year}` ?? "",
      organization: organization?.name ?? "",
      title: project?.title ?? "",
      description: project?.description ?? "",
      context: project?.contextProblematic ?? "",
      objectives: project?.objectives ?? "",
      needsConstraints: project?.needsConstraints ?? "",
      results: project?.expectedResults ?? "",
      expertises: project?.requiredSkills ?? "",
      teamCount: project?.numberOfTeamsRequested.toString() ?? "",
      preidentifiedStudents:
        "Student 1, Student 2, Student 3, Student 4, Student 5",
      isConfidential: "Oui",
      needsNDA: "Oui",
      isCessionIntellectual: "Oui",
      cessionNature: "Nature de type III",
      isMultiDept: "Oui",
      otherDepts: "TI, LOG, ELE",
      studentsPerDept: project?.numberOfStudents.toString() ?? "",
      preassignedTeacher: "Alain April",
      comments:
        "Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book.",
      timestamp: project?.submissionDate.toLocaleString() ?? "",
      encouragementType: getEncouragementTypeValue(project?.encouragementType),
      acceptsCloud: project?.authorizesCloudComputing ? "Oui" : "Non" ?? "",
      acceptsCloudQc: project?.authorizesCloudOutsideQuebec
        ? "Oui"
        : "Non" ?? "",
    },
  ];
}

// Type: EncouragementType
function getEncouragementTypeValue(encouragementType) {
  switch (encouragementType) {
    case EncouragementType.WEEKLY:
      return "Hebdomadaire";
    case EncouragementType.UPON_REQUEST:
      return "Sur demande";
    case EncouragementType.NO_ENCOURAGEMENT:
      return "Aucun";
    default:
      return "";
  }
}
